import React from 'react'
import './Menu.css'

function Menu() {
    return (
        <div>
            <div className="Menu">
                <h1>SFPOPOS</h1>
                <div className="Menu-Subtitle">San Franciscos Privately Owned Public Spaces</div>
            </div>
        </div>
    )
}

export default Menu
